tionary.</td> </tr> </table> <p><b>Boyo</b> may refer to&#160;:</p> <dl> <dt>Places</dt> </dl> <ul> <li><a href="/wiki/Boyo_(department)" title="Boyo (department)">Boyo (department)</a>, a division of the Northwest province in Cameroon</li> <li><a href="/wiki/B%C5%8Dyo_Islands" title="Bōyo Islands">Bōyo Islands</a>, a group of islands in the Inland Sea, Japan</li> </ul> <dl> <dt>People</dt> </dl> <ul> <li><a href="/wiki/Billy_Boyo" title="Billy Boyo">Billy Boyo</a> (1969–2000), Jamaican reggae artist</li> <li><a href="/wiki/Boyo_Ockinga" title="Boyo Ockinga">Boyo Ockinga</a> (active from 1986), New Zealand-born egyptologist, epigrapher and philologist working in Australia</li> </ul> <dl> <dt>Other</dt> </dl> <ul> <li>Boyo, an Irish and Welsh variation on the word <a href="/wiki/Boy" title="Boy">boy</a></li> <li><i><a href="/wiki/Boyo_v_London_Borough_of_Lambeth" title="Boyo v London Borough of Lambeth">Boyo v London Borough of Lambeth</a></i>, a 1994 UK labour law case, concerning wrongful dismissal</li> </ul> <h2><span class="mw-headline" id="See_also">See also</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Boyo&amp;action=edit&amp;section=1" title="Edit section: See also">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><span class="selfreference"><a href="/wiki/Special:Search/intitle:%22Boyo%22" title="Special:Search/intitle:&quot;Boyo&quot;">All pages with a title containing <i>Boyo</i></a></span></li> </ul> <table id="disambigbox" class="metadata plainlinks dmbox dmbox-disambig" style="" role="presentation"> <tr> <td class="mbox-image" style="padding: 2px 0 2px 0.4em;"><a href="/wiki/File:Disambig_gray.svg" class="image"><img alt="Disambiguation icon" src="//upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/30px-Disambig_gray.svg.png" width="30" height="23" srcset="//upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/45px-Disambig_gray.svg.png 1.5x, /